-- title:  Clicker Quest
-- author: Balistic Ghoul Studios
-- desc:   A cliker game, Inspiered by Clicker Heros and Cookie Cliker
-- script: lua

t=0
x=96
y=24
click=false
down=false
c=0
cpc=1
ac=0
acp=50
sc=0
scp=100
l=0
lp=300
enemy=260
col=8

wrl=0

function TIC()
 mx,my,md=mouse()
	
	t=t+1
	if t>60/ac then
	 t=0
	 c=c+1
	end
	
	if my>0 and my<22 and mx<240 and mx>152 and md and not mdp and c>=acp and ac<60 then
	 ac=ac+1
		c=c-acp
		acp=math.floor(acp*1.5)
	end
	
	if my>24 and my<47 and mx<240 and mx>152 and md and not mdp and c>=scp then
	 cpc=cpc+1
		sc=sc+1
		c=c-scp
		scp=math.floor(scp*1.5)
	end
	
	if my>48 and my<72 and mx<240 and mx>152 and md and not mdp and c>=lp and l<46 then
	 l=l+1
		c=c-lp
		lp=math.floor(lp*1.5)
	end
	
	if my>50 and my<90 and mx<90 and mx>50 and md and not mdp then
	 c=c+cpc
		if l>0 and math.random(1,100-(l*2))==1 then
		 c=c+(cpc*4)
		end
	end
	
	if my>50 and my<90 and mx<90 and mx>50 and md then
	 down=true
	else
	 down=false
	end
	
	mdp=md
	
 cls(0)
	rect(0,0,151,14,4)
	rect(152,0,88,72,2)
	line(152,23,240,23,2)
	line(152,47,240,47,2)
	spr(wrl,8,13,0,4,0,0,4,4)
	if down then
	 spr(enemy,47,34,col,3,0,0,2,2)
	else
  spr(enemy,56,46,col,2,0,0,2,2)
 end
	print(c,2,2,15,false,2)
	if ac<60 then
	spr(492,154,3,13,2) 
 end
 spr(493,154,27,13,2) 
 if l<46 then
  spr(496,154,50,0,2)
 end
	if ac<60 then
	 print("Auto Clicker",172,1)
	 print("Amount:",172,9) print(ac,212,9)
	 print("Price:",172,17)	print(acp,206,17)
 end
	print("Gold Clicks",172,25)
	print("Amount:",172,33) print(sc,212,33)
	print("Price:",172,41)	print(scp,206,41)
 if l<46 then
	 print("Luck",172,49)
	 print("Amount:",172,57) print(l,212,57)
  print("Price:",172,65)	print(lp,206,65)
 end
	if c==0 then --Grass
	 wrl=0
		enemy=260
	elseif c>99 then --Desert
	 wrl=4
		enemy=356
	elseif c>199 then --Ocean
	 wrl=8
		enemy=298
	elseif c>299 then --Volcano
	 wrl=12
		enemy=328
	elseif c>399 then --Tundra
	 wrl=64
		enemy=300
	elseif c>499 then --Rock Plains
	 wrl=68
		enemy=296
	elseif c>599 then --Library
	 wrl=72
		enemy=302
	elseif c>699 then --Astral Rift
	 wrl=76
		enemy=332
	elseif c>799 then --Blood Plains
	 wrl=128
		enemy=326
		col=11
	elseif c>899 then --Treasue Cave
	 wrl=132
		enemy=294
		col=8
	elseif c>999 then --Hive
	 wrl=136
		enemy=360
	elseif c>1099 then --The Void
	 wrl=140
		enemy=268
	elseif c>1199 then --The Mine
	 wrl=192
		enemy=388
	elseif c>1299 then --The Sewer
	 wrl=196
		enemy=364
	elseif c>1399 then --Candy Land
	 wrl=200
		enemy=362
	elseif c>1499 then --The Tower
	 wrl=204
		enemy=390
	elseif c>4999 then
		cls(0)
		print("You Win! :)",12*8,6*8)
	end
end

